# -*- coding: utf-8 -*-

import execjs

string = ""

with open("main.js", "r", encoding='utf-8') as f:
    js_file = f.read()  # 读取js文件
    js = execjs.compile(js_file)  # 编译执行js代码


def parse_ship_track(a, js_obj=js):
    res = js_obj.call('analyseAisTrack', a)  # 调用函数 token为js里面的函数  a为传的参数
    return res


if __name__ == '__main__':
    res = parse_ship_track(string)
    # for item in res:
    #     print(item)
    # print(res)
    print(type(res))
